def power(a,n):
    if(n==0):
        return 1
    if(n==1):
        return a
    x=power(a,n>>1)
    x=(x*x)
    if(x>=MOD):
        x%=MOD
    if(n&1):
        x=(x*a)
        if(x>=MOD):
            x%=MOD
    return x
